import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { useEffect, useState } from "react";

/* ---------- AUTH ---------- */
const authHeader = {
  Authorization: "Basic " + btoa("admin:admin123"),
  "Content-Type": "application/json"
};

/* ---------- UTIL ---------- */
const fetchJson = (url, setter) => {
  fetch(url, { headers: authHeader })
    .then(res => res.json())
    .then(setter)
    .catch(console.error);
};

const formatUptime = (seconds = 0) => {
  const hrs = Math.floor(seconds / 3600);
  const mins = Math.floor((seconds % 3600) / 60);
  const secs = seconds % 60;
  return `${hrs.toString().padStart(2, "0")}:${mins
    .toString()
    .padStart(2, "0")}:${secs.toString().padStart(2, "0")}`;
};

/* ---------- TABLE ---------- */
const DataTable = ({ data }) => (
  <table style={styles.table}>
    <tbody>
      {Object.entries(data || {}).map(([k, v]) => (
        <tr key={k}>
          <td style={styles.key}>{k}</td>
          <td style={styles.value}>{String(v)}</td>
        </tr>
      ))}
    </tbody>
  </table>
);

/* ---------- PAGES ---------- */

const Home = () => (
  <div>
    <h2>üöÄ Hello Server Dashboard</h2>
    <p>Select a section from the navigation bar.</p>
  </div>
);

const Health = () => {
  const [data, setData] = useState({});
  useEffect(() => fetchJson("http://localhost:8080/health", setData), []);
  return (
    <>
      <h2>ü©∫ Health</h2>
      <DataTable data={data} />
    </>
  );
};

const AppInfo = () => {
  const [data, setData] = useState({});
  useEffect(() => fetchJson("http://localhost:8080/app", setData), []);
  return (
    <>
      <h2>üì¶ App Info</h2>
      <DataTable data={data} />
    </>
  );
};

const Version = () => {
  const [data, setData] = useState({});
  useEffect(() => fetchJson("http://localhost:8080/version", setData), []);
  return (
    <>
      <h2>üîñ Version</h2>
      <DataTable data={data} />
    </>
  );
};

const Metrics = () => {
  const [data, setData] = useState({});
  useEffect(() => fetchJson("http://localhost:8080/metrics", setData), []);
  return (
    <>
      <h2>üìä Metrics</h2>
      <DataTable data={data} />
    </>
  );
};

const Uptime = () => {
  const [seconds, setSeconds] = useState(0);

  useEffect(() => {
    fetch("http://localhost:8080/uptime", { headers: authHeader })
      .then(res => res.json())
      .then(data => setSeconds(data.uptimeSeconds));

    const interval = setInterval(() => {
      fetch("http://localhost:8080/uptime", { headers: authHeader })
        .then(res => res.json())
        .then(data => setSeconds(data.uptimeSeconds));
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  return (
    <>
      <h2>‚è± Server Uptime</h2>
      <div style={styles.uptimeBox}>{formatUptime(seconds)}</div>
    </>
  );
};

/* ---------- APP ---------- */

export default function App() {
  return (
    <BrowserRouter>
      <div style={styles.page}>
        <nav style={styles.nav}>
          <Link to="/">Home</Link>
          <Link to="/health">Health</Link>
          <Link to="/app">App</Link>
          <Link to="/version">Version</Link>
          <Link to="/metrics">Metrics</Link>
          <Link to="/uptime">Uptime</Link>
        </nav>

        <div style={styles.card}>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/health" element={<Health />} />
            <Route path="/app" element={<AppInfo />} />
            <Route path="/version" element={<Version />} />
            <Route path="/metrics" element={<Metrics />} />
            <Route path="/uptime" element={<Uptime />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

/* ---------- STYLES ---------- */

const styles = {
  page: {
    minHeight: "100vh",
    background: "linear-gradient(135deg, #667eea, #764ba2)",
    padding: "30px",
    fontFamily: "Segoe UI, sans-serif"
  },
  nav: {
    display: "flex",
    gap: "15px",
    marginBottom: "20px",
    color: "#fff"
  },
  card: {
    background: "#fff",
    padding: "25px",
    borderRadius: "14px",
    boxShadow: "0 20px 40px rgba(0,0,0,0.25)"
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: "15px"
  },
  key: {
    padding: "10px",
    fontWeight: "bold",
    borderBottom: "1px solid #e5e7eb",
    width: "40%"
  },
  value: {
    padding: "10px",
    borderBottom: "1px solid #e5e7eb"
  },
  uptimeBox: {
    fontSize: "28px",
    fontWeight: "bold",
    marginTop: "20px",
    background: "#f1f5f9",
    padding: "20px",
    borderRadius: "12px",
    textAlign: "center"
  }
};
